import React from 'react'

const Exercicio1 = () => {

const nomes = ['Alice', 'Bob', 'Carol', 'David'];

return (
    <div>
      {nomes.map((item, index) => (
        <div key={index}>
          <li>{item.name}</li>
          <li>{item.banda}</li>
          <li>{item.talento}</li>
        </div>
      ))}
    </div>
  );
};

export default Exercicio1
